    return Promise.all([
      promiseSumFunction(1, 2).should.eventually.eq(3),
      promiseSumFunction(2, -2).should.be.rejected,
      promiseSumFunction2(1, 2).should.become(Obj),
      promiseSumFunction2(1, 2).should.become(Obj),
    ]);
  });
});

